INSERT INTO students (id, name, short_description, long_description, image, categories, services, email, phone, instagram, facebook, tiktok, portfolio_url, resume_url) VALUES ('binyamin', 'בנימין', 'עורך סרטונים מקצועי עם עין לפרטים', 'בנימין עורך סרטונים ברמה גבוהה. הוא מתמחה בעריכת תוכן לרשתות חברתיות, סרטוני תדמית ופרויקטים יצירתיים. הוא מביא סיפור ויזואלי מרתק לכל פרויקט.', '/placeholder.svg', '{"הפקת וידאו","שיעורים וחוגים","תלת-מימד","מייקרס"}', '{"מייקרס":["הדפסות תלת מימד"],"תלת-מימד":["מידול בתלת מימד Blender"],"הפקת וידאו":["עריכת וידאו"],"שיעורים וחוגים":["שיעור עריכת וידאו","שיעור תורה"]}', 'studio@chamama.org', '050-0000009', NULL, NULL, NULL, NULL, NULL) ON CONFLICT (id) DO NOTHING;
