INSERT INTO students (id, name, short_description, long_description, image, categories, services, email, phone, instagram, facebook, tiktok, portfolio_url, resume_url) VALUES ('ido', 'עידו', 'בנאי עץ מיומן – מתמחה בכלובים מעוצבים מעץ', 'עידו בונה כלובים ומבנים מעץ בעבודת יד מדויקת. הוא משלב בין פונקציונליות לאסתטיקה, ויוצר מוצרים ייחודיים ואיכותיים. כל פרויקט הוא מלאכת מחשבת.', '/placeholder.svg', '{"שיעורים וחוגים","מייקרס"}', '{"מייקרס":["נגרות ובניית בעץ","עבודות מתכת"],"שיעורים וחוגים":["חוגי מייקרים לילדים"]}', 'studio@chamama.org', '050-0000006', NULL, NULL, NULL, NULL, NULL) ON CONFLICT (id) DO NOTHING;
INSERT INTO students (id, name, short_description, long_description, image, categories, services, email, phone, instagram, facebook, tiktok, portfolio_url, resume_url) VALUES ('emma', 'אמה', 'מנהיגה, זמרת, כותבת ויוצרת קרושה', 'אמה משלבת בין כישורי מנהיגות לכישרון אמנותי. היא מנהלת צוותים, כותבת טקסטים ושירים, שרה ויוצרת עבודות קרושה ייחודיות. היא מביאה אנרגיה חיובית ומקצועיות לכל פרויקט.', '/placeholder.svg', '{"עיצוב גרפי","שיעורים וחוגים"}', '{"עיצוב גרפי":["עיצוב כרזות ועלונים","עיצוב לוגו"],"שיעורים וחוגים":["חוגי יצירה לילדים"]}', 'studio@chamama.org', '050-0000002', NULL, NULL, NULL, NULL, NULL) ON CONFLICT (id) DO NOTHING;
INSERT INTO students (id, name, short_description, long_description, image, categories, services, email, phone, instagram, facebook, tiktok, portfolio_url, resume_url) VALUES ('miyael', 'מיאל', 'מוזיקאית רב-תחומית, יוצרת תכשיטים ומאמנת כוח וקונג פו', 'מיאל היא מוזיקאית מגוונת המנגנת גיטרה, שרה וכותבת שירים מקוריים. לצד המוזיקה, היא עוסקת בתכשיטנות יצירתית ומלמדת קונג פו ואימוני כוח. היא מאמינה בשילוב בין אמנות לגוף ומביאה גישה ייחודית לכל פרויקט.', '/images/miyael.jpeg', '{"הפקה מוזיקלית","שיעורים וחוגים"}', '{"הפקה מוזיקלית":["הפקת שיר"],"שיעורים וחוגים":["חוגי יצירה לילדים","חוגי ספורט ובריאות הגוף"]}', 'studio@chamama.org', '050-0000001', NULL, NULL, NULL, NULL, NULL) ON CONFLICT (id) DO NOTHING;
INSERT INTO students (id, name, short_description, long_description, image, categories, services, email, phone, instagram, facebook, tiktok, portfolio_url, resume_url) VALUES ('noga', 'נוגה', 'תופרת, יוצרת תכשיטים, מדריכת סיורים ובשלנית', 'נוגה יוצרת ביצירתיות ובאהבה. היא תופרת בגדים ואקססוריז, מעצבת תכשיטים, מדריכה סיורים ייחודיים ומבשלת ארוחות מיוחדות. היא מחברת בין מסורת לחדשנות.', '/placeholder.svg', '{"שיעורים וחוגים","מייקרס"}', '{"מייקרס":["טקסטיל - תיקון ותפירה"],"שיעורים וחוגים":["חוגי יצירה לילדים"]}', 'studio@chamama.org', '050-0000004', NULL, NULL, NULL, NULL, NULL) ON CONFLICT (id) DO NOTHING;
