INSERT INTO students (id, name, short_description, long_description, image, categories, services, email, phone, instagram, facebook, tiktok, portfolio_url, resume_url) VALUES ('idan', 'עידן', 'מהנדס רובוטיקה ואלקטרוניקה צעיר ויצירתי', 'עידן בונה רובוטים ומערכות אלקטרוניות מאפס. הוא משלב בין תכנות, חומרה ויצירתיות כדי ליצור פתרונות טכנולוגיים חדשניים. התשוקה שלו לטכנולוגיה מניעה אותו ליצור דברים מדהימים.', '/images/idan.jpeg', '{"הפקת וידאו","שיעורים וחוגים","מייקרס","אפליקציות ואתרים"}', '{"מייקרס":["טקסטיל - תיקון ותפירה","חיתוך לייזר ו-CNC","הדפסות תלת מימד"],"הפקת וידאו":["עריכת וידאו","צילום אירועים"],"שיעורים וחוגים":["חוגי מייקרים לילדים"],"אפליקציות ואתרים":["בניית אפליקציית ווב"]}', 'studio@chamama.org', '050-0000010', NULL, NULL, NULL, NULL, NULL) ON CONFLICT (id) DO NOTHING;
