INSERT INTO services (id, title, slug, short_description, long_description, image, category) VALUES ('3623340a-c99e-42f3-aeca-453cb74f44c8', 'הפקת שיר', 'music-editing', 'הפקה מוזיקלית, מיקס ועריכת שמע — מרעיון לשיר מוגמר', 'שירות הפקה ועריכה מוזיקלית הכולל הקלטה, מיקס, מאסטרינג ועיבוד מוזיקלי. מתאים ליוצרים עצמאיים, להקות, ופרויקטים יצירתיים מכל הסוגים.', '/images/service-music-editing.jpg', 'הפקה מוזיקלית') ON CONFLICT (id) DO NOTHING;
INSERT INTO services (id, title, slug, short_description, long_description, image, category) VALUES ('f8a2f83d-a968-4920-ad05-89e808606ac2', 'חוגי יצירה לילדים', 'art-workshops-kids', 'חוגי יצירה מגוונים לילדים — ציור, פיסול, קולאז׳ ועוד', 'חוגי יצירה מותאמים לגילאים שונים, המשלבים טכניקות אמנותיות מגוונות כמו ציור, פיסול, קולאז׳ ועבודה עם חומרים ממוחזרים. החוגים מעודדים חשיבה יצירתית, עבודת צוות והנאה מהתהליך.', '/images/service-art-workshops.jpg', 'שיעורים וחוגים') ON CONFLICT (id) DO NOTHING;
INSERT INTO services (id, title, slug, short_description, long_description, image, category) VALUES ('70495057-34e5-432c-9da3-a321007fc601', 'צילום אירועים', 'event-photography', 'צילום מקצועי לאירועים, ימי הולדת, בר/בת מצוות ואירועים מיוחדים', 'שירות צילום אירועים מקיף — מהתכנון ועד המסירה. החניכים שלנו מתמחים בצילום אירועים, אירועים משפחתיים ואירועים עסקיים, עם דגש על רגעים אותנטיים ותוצאות מקצועיות.', '/images/service-event-photography.jpg', 'הפקת וידאו') ON CONFLICT (id) DO NOTHING;
INSERT INTO services (id, title, slug, short_description, long_description, image, category) VALUES ('503f3ef2-07c0-49c8-9409-7aba8a65a793', 'עריכת וידאו', 'video-editing', 'עריכת סרטונים מקצועית לכל מטרה — מתוכן לרשתות ועד סרטוני תדמית', 'שירות עריכת וידאו מקצועי הכולל עריכת סרטונים לרשתות חברתיות, סרטוני תדמית, קליפים ועוד. החניכים שלנו עובדים עם תוכנות מקצועיות ומביאים גישה יצירתית וצעירה לכל פרויקט.', '/images/service-video-editing.jpg', 'הפקת וידאו') ON CONFLICT (id) DO NOTHING;
INSERT INTO services (id, title, slug, short_description, long_description, image, category) VALUES ('92124912-7545-411e-9f5c-69f7c3756007', 'חוגי תכנות לילדים', 'coding-workshops-kids', 'חוגי תכנות לילדים — Scratch, Python ועוד', 'חוגי תכנות מותאמים לילדים ונוער, מ-Scratch למתחילים ועד Python למתקדמים. הילדים לומדים חשיבה לוגית, פתרון בעיות ובניית פרויקטים דיגיטליים משלהם.', '/images/service-coding-kids.jpg', 'שיעורים וחוגים') ON CONFLICT (id) DO NOTHING;
INSERT INTO services (id, title, slug, short_description, long_description, image, category) VALUES ('d17d1603-c1a8-44d7-a1f4-62839c2234e9', 'חוגי מייקרים לילדים', 'makers-workshops-kids', 'חוגי מייקרים — אלקטרוניקה, רובוטיקה ויצירה טכנולוגית', 'חוגי מייקרים המשלבים אלקטרוניקה, רובוטיקה, הדפסת תלת מימד ועבודה עם כלים. הילדים בונים פרויקטים אמיתיים ולומדים לחשוב כמו מהנדסים ויוצרים.', '/images/service-makers-kids.jpg', 'שיעורים וחוגים') ON CONFLICT (id) DO NOTHING;
INSERT INTO services (id, title, slug, short_description, long_description, image, category) VALUES ('026c32d5-3143-4251-a89d-d24012764e35', 'שיעור עריכת וידאו', 'video-editing-lesson', 'שיעורים פרטיים בעריכת וידאו — Premiere, DaVinci ועוד', 'שיעורים פרטיים או קבוצתיים בעריכת וידאו, עם התמקדות בתוכנות מקצועיות כמו Premiere Pro ו-DaVinci Resolve. מתאים למתחילים ולמתקדמים.', '/images/service-video-lesson.jpg', 'שיעורים וחוגים') ON CONFLICT (id) DO NOTHING;
INSERT INTO services (id, title, slug, short_description, long_description, image, category) VALUES ('4cba630c-040d-4add-887b-6ce8ad4d462b', 'שיעור בהפקת סאונד', 'sound-production-lesson', 'שיעורים בהפקת סאונד — הקלטה, מיקס ומאסטרינג', 'שיעורים מעשיים בהפקת סאונד הכוללים עבודה עם תוכנות DAW, טכניקות הקלטה, מיקס ומאסטרינג. מתאים למוזיקאים צעירים ולכל מי שמתעניין בעולם האודיו.', '/images/service-sound-production.jpg', 'שיעורים וחוגים') ON CONFLICT (id) DO NOTHING;
INSERT INTO services (id, title, slug, short_description, long_description, image, category) VALUES ('a65a2e3f-9fd6-4482-a1a6-6881dba0ce88', 'הפקת מוזיקה מקורית לסרט/הצגה', 'original-music-production', 'הלחנה והפקת מוזיקה מקורית לסרטים, הצגות ופרויקטים', 'הלחנה והפקה של מוזיקה מקורית המותאמת לפרויקט — סרט קצר, הצגת בית ספר, סרטון תדמית או כל יצירה אחרת. כולל עבודה צמודה עם הלקוח להתאמת האווירה והסגנון.', '/images/service-original-music.jpg', 'הפקה מוזיקלית') ON CONFLICT (id) DO NOTHING;
INSERT INTO services (id, title, slug, short_description, long_description, image, category) VALUES ('d1e2f665-7554-4867-970a-477907a6a7ca', 'עיצוב כרזות ועלונים', 'poster-flyer-design', 'עיצוב כרזות, פלאיירים ועלונים לאירועים ופרויקטים', 'עיצוב גרפי מקצועי של כרזות, פלאיירים ועלונים לאירועים, קמפיינים ופרויקטים. עיצוב מותאם אישית עם דגש על מסר ברור ויזואל מושך.', '/images/service-poster-design.jpg', 'עיצוב גרפי') ON CONFLICT (id) DO NOTHING;
INSERT INTO services (id, title, slug, short_description, long_description, image, category) VALUES ('f955765d-43d5-4a10-ac0f-99904af422e1', 'עיצוב סושיאל ואתרים', 'social-web-design', 'עיצוב פוסטים לרשתות חברתיות ועיצוב אתרים', 'עיצוב תוכן לרשתות חברתיות — פוסטים, סטוריז, באנרים — וכן עיצוב ממשקי אתרים. שפה עיצובית אחידה ומותאמת למותג.', '/images/service-social-design.jpg', 'עיצוב גרפי') ON CONFLICT (id) DO NOTHING;
INSERT INTO services (id, title, slug, short_description, long_description, image, category) VALUES ('783a2c47-703e-470c-b01c-3552dd90305f', 'עיצוב לוגו', 'logo-design', 'עיצוב לוגו ומיתוג ויזואלי', 'עיצוב לוגו מקורי ומקצועי הכולל תהליך מחקר, סקיצות ראשוניות ועיבוד סופי. מתאים לעסקים קטנים, עמותות ופרויקטים אישיים.', '/images/service-logo-design.jpg', 'עיצוב גרפי') ON CONFLICT (id) DO NOTHING;
INSERT INTO services (id, title, slug, short_description, long_description, image, category) VALUES ('0ad1f1c3-a77c-4cba-9dec-5ed723e738ba', 'מידול בתלת מימד Blender', '3d-modeling-blender', 'מידול ועיצוב תלת מימדי בתוכנת Blender', 'שירותי מידול תלת מימדי בתוכנת Blender — יצירת אובייקטים, דמויות, סצנות ואנימציות. מתאים לפרויקטים אמנותיים, משחקים וסרטונים.', '/images/service-3d-blender.jpg', 'תלת-מימד') ON CONFLICT (id) DO NOTHING;
INSERT INTO services (id, title, slug, short_description, long_description, image, category) VALUES ('8c2e2d22-cba6-4d32-9839-fa7e6d0aa1f0', 'מידול בתלת מימד SolidWorks', '3d-modeling-solidworks', 'מידול הנדסי מדויק בתוכנת SolidWorks', 'מידול תלת מימדי הנדסי בתוכנת SolidWorks — תכנון חלקים מכניים, הרכבות ושרטוטים טכניים. מתאים לפרויקטים טכנולוגיים ולמייקרים.', '/images/service-3d-solidworks.jpg', 'תלת-מימד') ON CONFLICT (id) DO NOTHING;
INSERT INTO services (id, title, slug, short_description, long_description, image, category) VALUES ('e8683bba-8e62-470d-9327-4bfed80a544c', 'הפקת סרטון תדמית', 'promo-video-production', 'הפקת סרטוני תדמית מקצועיים לעסקים ועמותות', 'הפקה מלאה של סרטון תדמית — מתסריט ועד עריכה סופית. כולל צילום, עריכה, גרפיקה ומוזיקה. מתאים לעסקים קטנים, עמותות ופרויקטים חברתיים.', '/images/service-promo-video.jpg', 'הפקת וידאו') ON CONFLICT (id) DO NOTHING;
INSERT INTO services (id, title, slug, short_description, long_description, image, category) VALUES ('ad6b9a4b-2623-4957-af77-c052b7b42ac8', 'הפקת סרטון אנימציה', 'animation-video-production', 'הפקת סרטוני אנימציה — 2D ו-3D', 'הפקת סרטוני אנימציה מקוריים בטכניקות שונות — 2D, 3D, מושן גרפיקס ועוד. מתאים לסרטוני הסברה, פרסומות ופרויקטים יצירתיים.', '/images/service-animation.jpg', 'הפקת וידאו') ON CONFLICT (id) DO NOTHING;
INSERT INTO services (id, title, slug, short_description, long_description, image, category) VALUES ('15640255-b385-4541-bdcd-e98594c9ea57', 'נגרות ובניית בעץ', 'woodworking', 'עבודות נגרות — בניית ריהוט, מדפים ופרויקטים מעץ', 'שירותי נגרות מקצועיים הכוללים בניית ריהוט בהתאמה אישית, מדפים, כלובים ופרויקטים מיוחדים מעץ. עבודה עם כלי עבודה מקצועיים ודגש על איכות ועיצוב.', '/images/service-woodworking.jpg', 'מייקרס') ON CONFLICT (id) DO NOTHING;
INSERT INTO services (id, title, slug, short_description, long_description, image, category) VALUES ('1f8190bf-0135-4859-a268-de4418e8fecf', 'עבודות מתכת', 'metalwork', 'עבודות מתכת — ריתוך, עיצוב וכיפוף', 'שירותי עבודות מתכת הכוללים ריתוך, כיפוף, חיתוך ועיצוב. מתאים לפרויקטים אמנותיים, פונקציונליים ושילוב מתכת בפרויקטי מייקרס.', '/images/service-metalwork.jpg', 'מייקרס') ON CONFLICT (id) DO NOTHING;
INSERT INTO services (id, title, slug, short_description, long_description, image, category) VALUES ('b7c6eede-1e0b-40e1-b3b1-f26270794911', 'טקסטיל - תיקון ותפירה', 'textile-sewing', 'תיקון בגדים, תפירה ועבודות טקסטיל', 'שירותי תפירה ותיקון בגדים, עיצוב טקסטיל ויצירת פריטים בהתאמה אישית. כולל תיקונים, התאמות מידה ויצירת פרויקטים מאפס.', '/images/service-textile.jpg', 'מייקרס') ON CONFLICT (id) DO NOTHING;
INSERT INTO services (id, title, slug, short_description, long_description, image, category) VALUES ('9e26d254-b41d-4b2a-b5c1-a08fa2fe4b5c', 'בניית אפליקציית ווב', 'web-app-development', 'פיתוח אפליקציות ווב מותאמות אישית', 'פיתוח אפליקציות ווב מקצועיות ומותאמות אישית — מאפליקציות ניהול ועד פלטפורמות שירות. שימוש בטכנולוגיות מודרניות עם דגש על חוויית משתמש וביצועים.', '/images/service-web-app.jpg', 'אפליקציות ואתרים') ON CONFLICT (id) DO NOTHING;
INSERT INTO services (id, title, slug, short_description, long_description, image, category) VALUES ('528d0675-39ca-43da-b774-888ddf906292', 'בניית ועיצוב אתר', 'website-design', 'עיצוב ובניית אתרים מקצועיים', 'בניית אתרי אינטרנט מעוצבים ורספונסיביים לעסקים, עמותות ופרויקטים אישיים. כולל עיצוב UI/UX, התאמה למובייל ואופטימיזציה למנועי חיפוש.', '/images/service-website-design.jpg', 'אפליקציות ואתרים') ON CONFLICT (id) DO NOTHING;
INSERT INTO services (id, title, slug, short_description, long_description, image, category) VALUES ('d34381f7-c9ed-4d6b-8aa9-1ed131797c1a', 'יצירת משחקים חינוכיים', 'educational-games', 'פיתוח משחקים חינוכיים דיגיטליים', 'יצירת משחקים חינוכיים אינטראקטיביים המשלבים למידה עם הנאה. מתאים לבתי ספר, עמותות וארגונים חינוכיים שרוצים להנגיש תכנים בצורה מעניינת.', '/images/service-edu-games.jpg', 'אפליקציות ואתרים') ON CONFLICT (id) DO NOTHING;
INSERT INTO services (id, title, slug, short_description, long_description, image, category) VALUES ('8a363b14-ebeb-421e-9d83-86d50557341a', 'הטמעת מערכות מחשוב ו-AI', 'ai-computing-systems', 'ייעוץ והטמעת פתרונות מחשוב ובינה מלאכותית', 'הטמעת מערכות מחשוב ופתרונות בינה מלאכותית מותאמים — אוטומציה, צ׳אטבוטים, ניתוח נתונים וכלי AI. ייעוץ טכנולוגי והתאמה לצרכי הארגון.', '/images/service-ai-systems.jpg', 'אפליקציות ואתרים') ON CONFLICT (id) DO NOTHING;
INSERT INTO services (id, title, slug, short_description, long_description, image, category) VALUES ('d5858664-7608-4795-845d-d04aa7f0916c', 'חוגי ספורט ובריאות הגוף', 'sports-health', 'חוגי ספורט, כושר ובריאות הגוף בהנחיית מאמנים צעירים ומוסמכים', 'חוגי ספורט ובריאות הגוף מציעים מגוון פעילויות גופניות בהנחיית מאמנים צעירים ומוסמכים. מאימוני כושר אישיים ועד שיעורי יוגה, פילאטיס וספורט קבוצתי — הכל מותאם לצרכים האישיים של כל משתתף. החוגים שלנו משלבים ידע מקצועי עם גישה רעננה וצעירה, ומספקים חוויה בריאותית מהנה ומעצימה.', '/images/service-sports-health.jpg', 'שיעורים וחוגים') ON CONFLICT (id) DO NOTHING;
INSERT INTO services (id, title, slug, short_description, long_description, image, category) VALUES ('bc36d7cd-a8a7-43cf-b3ca-d0f4720a009c', 'חיתוך לייזר ו-CNC', 'laser-cutting-cnc', 'חיתוך לייזר ועבודות CNC — חיתוך מדויק של חומרים שונים', 'שירותי חיתוך לייזר ו-CNC מקצועיים. חיתוך מדויק של עץ, אקריליק וחומרים נוספים ליצירת מוצרים, שלטים, קישוטים ועוד.', '/images/service-laser-cnc.jpg', 'מייקרס') ON CONFLICT (id) DO NOTHING;
INSERT INTO services (id, title, slug, short_description, long_description, image, category) VALUES ('9d9c88b6-f2b9-4b6b-9009-a619ed7cfec3', 'הדפסות תלת מימד', '3d-printing', 'הדפסות תלת מימד — יצירת אובייקטים ומודלים פיזיים', 'שירותי הדפסה תלת מימדית. יצירת מודלים, אבות טיפוס, חלקים מותאמים אישית ואובייקטים מעוצבים באמצעות מדפסות תלת מימד.', '/images/service-3d-printing.jpg', 'מייקרס') ON CONFLICT (id) DO NOTHING;
